Christmas is around the corner. A coat of snow is covering the gardens of the &quot;Russian Institute&quot; a luxury boarding school reserved to the posh girls of high society Muscovite families.
The new boarder, the young Oksana, is not the naive person that her delicious little face could let imagine. And if she comes there to perfect her instruction, it is rather a sensual and sexual high level education that she will receive.
Students, supervisors, professors and even the headmistress, all are obsessed by lust. And while, secretly, the lovers of these &quot;innocent young ladies&quot; join them and make love in every positions, single girls practise Sapphic games willingly.
Thus, under the twinkling gleam of the Christmas tree, Oksana and her girlfriends will know the rapture of devastating orgasms
